import { LEVELS } from './levels.enum';

export class Contact {
    name = '';
    lastName = '';
    email ='';
    online = false;

    constructor(name, lastName, email,online){
        this.name = name;
        this.lastName = lastName;
        this.email=  email;
        this.online = online;
    }
}
